function getArtboardLocation(i) {
  if (i < 4) {
    return [
      DOCUMENT_CENTER[0] + (ARTBOARD_WIDTH + ARTBOARD_PADDING) * i,
      DOCUMENT_CENTER[1],
    ];
  }

  return [
    DOCUMENT_CENTER[0] + (ARTBOARD_WIDTH + ARTBOARD_PADDING) * (i - 4),
    DOCUMENT_CENTER[1] + ARTBOARD_HEIGHT + ARTBOARD_PADDING,
  ];
}

function addElement(image, element, artboard) {
  const { name } = element;
  const { x, y } = element.position;
  const { width, height } = element.dimension;

  const imageFill = new scenegraph.ImageFill(image);
  const imageWidth = imageFill.naturalWidth;
  const imageHeight = imageFill.naturalHeight;

  const scale = Math.min(width / imageWidth, height / imageHeight);

  const rectNode = new scenegraph.Rectangle();
  rectNode.name = name;
  rectNode.width = imageWidth * scale;
  rectNode.height = imageHeight * scale;
  rectNode.fill = imageFill;
  artboard.addChild(rectNode);
  rectNode.moveInParentCoordinates(x, y);
}

function generateArtboard(uiPatternName, uiScreen, i) {
  const [x, y] = getArtboardLocation(i);

  const artboard = new scenegraph.Artboard();
  artboard.name = `${uiPatternName}_wireframe_${i}`;
  artboard.width = ARTBOARD_WIDTH;
  artboard.height = ARTBOARD_HEIGHT;
  artboard.fill = new scenegraph.Color("#F2F2F2");
  artboard.dynamicLayout = true;

  scenegraph.root.addChild(artboard);
  artboard.moveInParentCoordinates(x, y);

  uiScreen.forEach((element) => {
    const { name } = element;

    if (name === "other") {
      return;
    }

    const image = UI_ELEMENTS[name];

    addElement(image, element, artboard);
  });
}

// eslint-disable-next-line no-undef
const { error } = require("./lib/dialogs");

const generateScreen = (uiPattern) => async () => {
  try {
    const response = await fetch(AKIN_URL + uiPattern, {
      method: "POST",
    });
    if (!response.ok) {
      throw new Error(`Server overloaded`);
    }
    const uiScreens = await response.json();

    uiScreens.forEach((uiScreen, i) => {
      generateArtboard(uiPattern, uiScreen, i);
    });
  } catch (err) {
    await error("Server failed", `Sorry! ${error.message}`);
  }
};

var index = {
  commands: {
    generateLoginScreen: generateScreen("login"),
    generateAccountCreationScreen: generateScreen("account_creation"),
    generateProductListing: generateScreen("product_listing"),
    generateProductDescription: generateScreen("product_description"),
    generateSplashScreen: generateScreen("splash"),
  },
};

module.exports = index;
